INSERT INTO `tipo_de_atendimento` VALUES (1,'Ressonncia magnetica na regio da cabea','00:35:00','No possui efeitos colaterais.',1000),(2,'Acupuntura','01:15:00','No possui efeitos colaterais.',2323),(3,'Cirurgia','04:35:00','Possui riscos de efeitos colaterais de perda de movimento da mo, perda do movimento dos dedos.',34433),(4,'Cirurgia Torcica','08:20:00','O principal efeito colateral da simpatectomia  o chamado efeito compensatrio. Esse efeito  descrito quando ocorrem episdios de sudorese em outras partes do corpo que no eram habituais antes da cirurgia. Habitualmente, o efeito compensatrio ocorre no tronco, pernas, abdome, coxas, virilhas, ps e glteos. O efeito compensatrio tem grande relevncia, pois seu grau de intensidade influencia diretamente a qualidade de vida do paciente.',3433),(5,'Consulta perodica','00:30:00','No possui efeitos colaterais',433433),(6,'Cirurgia Vascular','01:30:00','Possui riscos de inchao e escoriaes',34322),(7,'Fisioterapia para as pernas','00:25:00','No possui efeitos colaterais',6543),(8,'Consulta peridica','05:00:00','O paciente pode sentir dor leve no momento da puno da fstula com as agulhas. Quanto aos efeitos colaterais, no geral, os pacientes so sentem nada, mas pode ocorrer queda da presso arterial, cimbras ou dor de cabea.',54233),(9,'Quimioterapia','02:20:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',34334),(10,'Consulta','00:45:00','No possui efeitos colaterais',98765),(11,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',4565),(12,'Diagnstico e tratamento da doena renal crnica','01:50:00','No possui efeitos colaterais',6453),(13,'Cirurgia','08:15:00','As complicaes neurolgicas incluem diminuio do nvel de conscincia, vasoespasmo, convulses, hipertenso intracraniana, dficits motores, entre outros. J as complicaes sistmicas incluem nuseas e vmitos, hipotenso, desconforto respiratrio e infeco do stio cirrgico, dor e infeces nosocomiais.',2455),(14,'Consulta','00:30:00','No possui efeitos colaterais',2353),(15,'Consulta','00:25:00','No possui efeitos colaterais',235235),(16,'Consulta','00:55:00','No possui efeitos colaterais',32676),(17,'Remoo das pedras nos rins','04:15:00',' comum sentir uma dor lombar aguda, unilateral, que tende a se deslocar para as partes mais baixas do abdome. Em alguns casos, os homens tambm sofrem um desconforto nos testculos e as mulheres, nos grandes lbios.',641236),(18,'Examinao das  glndulas','00:30:00','No possui efeitos colaterais',5643445),(19,'Diagnstico de doenas cardiovasculares','01:30:00','No possui efeitos colaterais',43544531),(20,'Cirurgia baritrica','09:15:00','Alguns efeitos colaterais, dependendo do tipo de cirurgia, so at comuns. Nos meses imediatamente posteriores  operao, relatos de perda leve de memria, irritao e insnia tornam-se habituais em hospitais e consultrios',53632),(21,'Transplante de fgado','04:40:00','Com o uso de imunossupressores podem surgir sintomas como inchao corporal, aumento do peso, aumento da quantidade de pelos no corpo, especialmente no rosto das mulheres, osteoporose, m digesto, queda de cabelo e aftas. Assim, deve-se observar os sintomas que aparecem e conversar com o mdico para que ele indique o que se pode fazer para controlar estes sintomas desagradveis, sem prejudicar o esquema de imunossupresso.',4543),(22,'Acompanhamento mdico','00:35:00','No possui efeitos colaterais',64334),(23,'Consulta','00:50:00','No possui efeitos colaterais',64324),(24,'Ultrassom','00:25:00','No possui efeitos colaterais',98765),(25,'Cirurgia na regio bucal','00:15:00',' O edema ou inchao pode ocorrer em maior, ou menor grau dependendo da pessoa;Dor no local. Devido  interveno,  comum que o local fique bastante dolorido; Cicatrizao. O processo de cicatrizao  relativo e pode demorar mais ou menos dependendo da pessoa; Trismo; Mau hlito; Parestesia; Dores de garganta.',324567),(26,'Terapia','00:50:00','No possui efeitos colaterais',123456),(27,'Substituio de uma medula ssea','06:50:00','Nusea e vmito; Feridas na boca; Fadiga; Nveis baixos de plaquetas, dificultando a coagulao do sangue; Nveis baixos de glbulos vermelhos, causando anemia; Diarreia.',1234567890),(28,'Cirurgia','10:15:00','Os efeitos colaterais ps-cirrgicos costumam desaparecer por volta dos primeiros 7 a 10 dias. A maioria dos pacientes se queixa de irritao ou sensao leve de areia nos olhos, coceira e sensibilidade a luz. ',34345),(29,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',64533),(30,'Remoro dos braos','00:56:00','sonolncia,\nexcessivo,\nboca seca,\nfadiga,\nAlergia,\ntremor,\nSuor,\nfadiga,\nsonolncia,\nexcessivo,\nSuor',51449),(31,'Remoro das pernas','02:45:00','boca seca,\nboca seca,\nboca seca,\nexcessivo,\nnusea,\ntremor',56741),(32,'Remoro dos olhos','00:28:00','boca seca,\nsonolncia,\nsonolncia,\ninsnia,\nnusea,\nSuor,\nsonolncia,\nAlergia,\ndiarreia,\nansiedade',48567),(33,'Remoro da lngua','03:06:00','boca seca,\nfadiga,\nsonolncia,\nfadiga,\nansiedade,\nboca seca,\nexcessivo,\ninsnia,\nsonolncia,\nansiedade',49479),(34,'Transplante dos braos','00:31:00','tremor,\nnusea,\nexcessivo,\nboca seca,\ninsnia,\nexcessivo,\nSuor,\ndiarreia,\nboca seca',50034),(35,'Transplante das pernas','00:24:00','tremor,\ntremor,\ndiarreia,\nnusea,\nnusea,\ndiarreia,\nfalta de apetite,',42768),(36,'Transplante dos olhos','00:16:00','',53615),(37,'Transplante da lngua','03:01:00','',48899),(38,'Analise dos braos','01:02:00','ansiedade',48465),(39,'Analise das pernas','01:05:00','tremor,\ndiarreia,\ntremor,\nfalta de apetite,',33028),(40,'Analise dos olhos','01:41:00','falta de apetite,,\nins